function log(o){xhr({url:"/log",async:!0,data:{user:localStorage.username,path:window.location.href,log:o},error:function(){}})}var log_in=API["in"];API["in"]=function(o){"string"==typeof o?(log(o),o=JSON.parse(o)):log(JSON.stringify(o)),log_in(o)};var log_out=API.out;API.out=function(o){"object"==typeof o&&(o=JSON.stringify(o)),log(o),log_out(o)};var log_reloadData=API.reloadData;API.reloadData=function(o){log(JSON.stringify(o)),log_reloadData(o)};